import React from 'react'; // Importando o React
import ReactDOM from 'react-dom'; // Importando o ReactDOM
import './index.css';  // Importando o CSS global
import App from './App';  // Importando o componente App

const rootElement = document.getElementById('root'); // Pegando o elemento de id 'root'
if (rootElement) {
  ReactDOM.render(
    <React.StrictMode>
      <App />
    </React.StrictMode>,
    rootElement
  );
}
